import React from 'react';
import ReactDOM from 'react-dom';
import { Provider } from 'react-redux'; // Importa el Provider
import store from './redux/store'; // Importa tu store de Redux
import App from './App'; // Importa tu componente raíz de la aplicación

const rootElement = document.getElementById('root');

// Utiliza createRoot en lugar de ReactDOM.render
const root = ReactDOM.createRoot(rootElement);
root.render(
  <Provider store={store}>
    <App />
  </Provider>
);
